, 
[7182] = {Title = "Sapha\'s Visit", 
Description = {"ผู้คนต่างพูดกันว่าชา\199 Sapha จา\161 Munak ได้มายังที่นี่แล้ว หลังจากได้รับความไว้วางใ\168 Aello จึงมอบหมายให้ข้า ไปพบกับคณะผู้แทนที่พักอยู่ในห้องพักที่มุมขวาบนชั้นที่สอง"}
, Summary = "พบปะกับคณะผู้แทนขอ\167 Sapha"}
, 
[7183] = {Title = "Invitation from Sapha", 
Description = {"ช่างน่าประหลาดใจ, Vyhannus ก็คื\205 Sapha ดินแดนแห่ง El Dicastes, เมืองหลวงของ Sapha นี่เอง โด\194 Ravail จา\161 Sapha เปิดกองทุน Capital to Human อยู่และได้เชื้อเชิญให้ข้าไปยังที่นั่\185 อย่างไรก็ตาม, ดูเหมือนว่ามันจำเป็นที่จะต้องได้รับการอนุญาตจา\161 Avalanche เสียก่อน, ผู้รักษาความปลอดภัยของ Munak, เพื่อให้สามารถผ่านเจ้าไปได\233"}
, Summary = "สนทนากับ Avalanche ที\232 Manuk"}
, 
[7184] = {Title = "To El Dicastes!", 
Description = {"ได้รับการยอมรับจาก Avalanche เพื่อใช้ช่องทางการเดินทา\167 ระหว่า\167 Manuk แล\208 เมืองหลว\167 El Dicastes สุดท้ายนี้ สามารถเดินทางไปยังเมืองหลวงแห่\167 Sapha!!"}
, Summary = ""}
, 
[7185] = {Title = "Inspector Doha", 
Description = {"ก่อนที่จะออกจากเมืองหลวง, Captain Hiba Agiff บอกแก่ข้าให้ไปพบกั\186 Inspector Doha แต่ข้าไม่รู้ว่าเพื่ออะไร และทำไ\193, แต่ก็ควรจะไปพบกั\186 Doha เสียก่อนที่จะออกไปยั\167 Manuk ซึ่ง Doha อาศัยอยู่ในห้องถัดไปจา\161 Vyhannus"}
, Summary = "สนทนากับ Inspector Doha"}
, 
[7186] = {Title = "Secret Order from Doha - Investigation", 
Description = {"Doha กล่าวว่า เขากำลังมองหาผู้ต้องสงสัยในกรณีที่รายงานถูกขโมยไ\187 เขาให้คำสั่งลับแก่ข้\210 เพื่อให้ตามรวบรวมเอกสารภายใน El Dicastes, ตามคำอธิบายของผู้ต้องสงสัย คาดว่าจะเป็นชายที่มีหูสัตว\236"}
, Summary = ""}
, 
[7187] = {Title = "Secret Order from Doha - Shay", 
Description = {"Shay คือผู้จัดการขอ\167 \'Burman Flone\', ผับที่อยุ่ภายใ\185 El Dicastes เขาแนะนำข้อมูลบางอย่างสำหรับ \'ผู้ชายที่มีหูสัตว์\' แก\232 Saphas ผู้อาศัยอยู่ภายในเมืองหลวงนี\233"}
, Summary = "สนทนาบางอย่างกับ Saphas เพื่อรับข้อมูล"}
, 
[7188] = {Title = "Information Gathering - In the Plaza", 
Description = {"หูแม\199 ? ไม่ใช่พ่อค้าขายแมว ? ข้าไม่รู้เหมือนกัน อย่างไรก็ตาม เจ้าได้ไปพบกับ Ahat แล้วหรือยั\167 ? เขาที่ดูสวมงาม แล\208 สูงศักดิ\236"}
, Summary = ""}
, 
[7189] = {Title = "Information Gathering - in the Factory", 
Description = {"ผู้ชายที่มีหูเป็นแมว ? ข้าไม่เคยได้ยินมันเลยน\208 อย่าเพ้อฝันมากนั\161 ตอนนี้เจ้าไปพบกั\186 Ahat ได้แล้\199 เขาเป็นคนดีทีเดียว! เขาคือต้นแบบของชาว Sapha!"}
, Summary = ""}
, 
[7190] = {Title = "Information Gathering - at the Guards", 
Description = {"หูแม\199? แจ้าแน่ใจอย่างนั้นรึ? เจาเป็นคนประเภทไหนกันเนี่ย? ทำไมเจ้ายังไม่ไปพบกั\186 Ahat อี\161 เขาคือชา\199 Sapha ที่เข้มแข็งผู้หนึ่\167 เขาอาจจะทำงานที่ Jarute ถึงจะอยู่กับกองเอกสา\195 แต่จริงๆ นั่นยังไม่ใช่พลังที่เค้ามีอยู่! !"}
, Summary = ""}
, 
[7191] = {Title = "Shay\'s designation - BK", 
Description = {"เพื่อความสะดวกในการรวบรวมข้อมู\197, Shay แนะน\211 BK จา\161 Cat Hand Agents ให้รู้จั\161 ข้อบอก BK แล้วว่\210 ^4d4dff\'Shay มีเครื่องดื่มพิเศษให้เขาด้วย\'^000000 ถ้\210 BK ไม่ช่วยข้านะ.."}
, Summary = "พบกั\186 BK"}
, 
[7192] = {Title = "BK\'s Information", 
Description = {"ตามข้อมูลของ BK, ชายผู้มีหูแมวอยู่ใกล้กันกั\186 Ahat, ชายผู้มีเสน่ที่สุด Capital of Sapha แต่เขากล่าวว่า Ahat ไม่ใช่ Sapha และถูกพบใกล้กันกับพื้นที่ที่เป็นรอยร้า\199 อะไรคือความสัมพันธ์ของมั\185?"}
, Summary = "พูดคุยกั\186 Shay"}
, 
[7193] = {Title = "Crack investigation", 
Description = {"หลังจากสนทนากั\186 Shay, ข้าควรจะไปสำรว\168 Southern Crack เพื่อหาความจริ\167 หวังว่ามันคงเป็นประโยชน์นะ"}
, Summary = "สำรวจบริเวณพื้นที่รอยแตก"}
, 
[7194] = {Title = "What\'s this bloodstain?", 
Description = {"เจ้าพบเลือดที่สกปร\161 ข้างๆกับรอยแตก ดูเหมือนมีเรื่องต้องคุยกับ Ahat?"}
, Summary = ""}
, 
[7195] = {Title = "What\'s this skin piece?", 
Description = {"เจ้าค้นพบชิ้นส่วนของผิวหนังของสิ่งมีชีวิ\181 ข้าง\230 กับรอยร้าวนั้น มีอะไรเกิดขึ้นกั\186 Ahat กันแน่?"}
, Summary = ""}
, 
[7196] = {Title = "What\'s this suspicious magic power?", 
Description = {"เจ้าค้นพบชิ้นส่วนของเวทย์มนตร์ ดูเหมือนมีพลังเวทย์มนตร์ไหลออกมาจากรอยร้าวนั้น ดูเหมือนมีเรื่องต้องคุยกับ Ahat?"}
, Summary = ""}
, 
[7197] = {Title = "Exploit Certifications? Exploit Certifications!", 
Description = {"สุดท้ายเจ้\210 ตัดสินใจที่จะไปพบกับ Ahat เพื่อหาทางออกของเรื่องเหล่านี้ แต่จำเป็นที่ต้องมีการรับรองของ Sapha เพื่อพบกับ Ahat ลองค้นหาบางภารกิจที่เจ้าสามารถทำได\233"}
, Summary = "รวบรวม 3 Exploit Certifications of Sapha"}
, 
[7198] = {Title = "Audience with Ahat", 
Description = {"สามารถสนทนากับ Ahat หลังจากมอบ 3 exploit certifications ให้แล้\199 สามารถพบกั\186 Ahat หลังจากเข้าไปยังสำนักงานโดยการขึ้นลิฟท\236 in Diel"}
, Summary = ""}
, 
[7199] = {Title = "Secret Order from Ahat", 
Description = {"Ahat มอบหมายให้ลบร่องรอยต่างๆรอบๆรอยร้าวนั้\185 เก็บสะสม Solid Bloodstain, Frozen Skin Pieces, แล\208 Suspicious Magic Stones มาอย่างล\208 10 ชิ้น"}
, Summary = ""}
, 
[7200] = {Title = "Cheshire\'s call", 
Description = {"เริ่มทำงานทีละเล็ก ละน้อย โดยไม่มีอะไรเปลี่ยนแปล\167 จงไปพบกั\186 Cheshire เมื่อถึงเวลาที่เหมาะสม"}
, Summary = ""}
, 
[7201] = {Title = "Clean up the crack", 
Description = {"ร่องรอยรอบๆรอยร้าวนั้นค่อย\230 จางหายไปด้วยฝีมือของ Ahat แล\208 Cheshire เหมือนอย่างเดิ\193, สะสม item ตามเดิมมาอย่างละ 10 ชิ้น"}
, Summary = ""}
, 
[7202] = {Title = "Secret order from Doha - Collect proof", 
Description = {"โดยไม่มีการบอกกล่าวจาก Cheshire แล\208 Ahat, ร่องรอยหลักฐานเหล่านั้\185 ถูกส่งไปยั\167 Doha เป็นหลักฐา\185 และส่งรายงาน สะสม 1 Solid Bloodstain, 1 Frozen Skin Piece, แล\208 1 Suspicious Magic Stone"}
, Summary = ""}
, 
[7203] = {Title = "Secret order from Doha - Final Report", 
Description = {"พูดคุยกั\186 Jarute คนอื่น\230, Heslanta เกี่ยวกับเรื่องต่า\167 หลังจากพูดคุยกับ Heslanta ได้ข้อสรุป และส่งรายงานไปยั\167 Doha"}
, Summary = "ส่งรายงานชิ้นสุดท้ายแก\232 Doha"}
, 
[7204] = {Title = "Spring Bringing Flower", 
Description = {"Bomy\',เด็กผู้หญิงที่น่ารักภายใ\185 Lutie, ต้องการที่จะรู้เกี่ยวกับดอกไม้แห่งฤดูใบไม้ผล\212 ข้าสัญญาว่าจะนำมันมามอบให้แก่เธอ บางท\213 5 Huge Spray of Flowers น่าจะเพียงพอ ข้าจะท\211.."}
, Summary = "นำของขวัญกลับมาให้กั\186 Bomy เด็กผู้หญิงแห่งฤดูใบไม้ผลิ"}
, 
[7206] = {Title = "The new days of Cheshire", 
Description = {"ท่านสามารถพบกับสมาชิกของ Cat Paw ถ้าหากท่านตรวจสอบส่วนกลางของ ^4d4dffKamidal Tunnel^000000. ^4d4dff ที่ฝั่งตะวันตกขอ\167 Skaraba Hall เข้าไปยังจุดขนส่งสินค้า^000000 กรุณาย้ายพวกมั\185 สถานที่ที่ท่านต้องย้ายไปอยู่ด้านบนของกล่อง"}
, Summary = ""}
, 
[7207] = {Title = "Cheshire\'s box", 
Description = {"ท่านพบกล่องที่ Cheshire พูดถึงใน Kamidal Tunnel ด้านใต้ของกล่องมีตัวอักษรเล็กๆเขียนไว้ว่\210, ^4d4dff ด้านเหนือของรอยแยกใน Bifrost^000000. นำมันกลับไปมอบให้กับ Cheshire ที่สามารถไปได้ทุกที่ใน Bifrost"}
, Summary = ""}
, 
[7208] = {Title = "And tomorrow, too, please?", 
Description = {"ยอมรับข้อเสนอในการขนย้ายกล่องไปยัง Cheshire หนึ่งครั้งต่อวันที\232 Kamidal Tunnel ถึงเวลาแล้\199 ไป...ไปรวบรวมมันได้แล้ว"}
, Summary = ""}
, 
[7209] = {Title = "Forget the box", 
Description = {"กล่องสูญหา\194 แทนที่จะเป็นกล่อ\167, Cheshire ขอให้ท่านรวบรว\193 20 Refined Bradium แท\185"}
, Summary = "Refined Bradium: 20 ชิ้น"}
, 
[7210] = {Title = "Daily delivery", 
Description = {"Cheshire กำลังร\205 Bradium box ท่านควรจะนำมันไปมอบให้ Cheshire ที่กำลังรออยู่ใน Bifrost"}
, Summary = ""}
, 
[7211] = {Title = "Explore the Foggy Forest", 
Description = {"สำรว\168 Foggy Forest. โด\194 foggy forest ยังจดจำเจ้าได้อยู่ ดังนั้นหากท่านพยายามที่จะเข้าไปมันอาจปฏิเสธท่านได้"}
, Summary = ""}
, 
[7212] = {Title = "Finding Loki", 
Description = {"บางโอกาส, ท่านพบบางคนที่มีชื่อ Loki ภายในป่านั้น ซึ่งกำลังมองหา Jarani ( อาจเป็นชื่\205? ) ที่มีผมสีม่ว\167 มันหมายความว่ายังไงกัน ? หากท่านพ\186 ท่านควรบอกให้กับ Loki รับรู้ด้วย ?"}
, Summary = ""}
, 
[7213] = {Title = "Wandering Protector", 
Description = {"สิ่งที\232 Loki กำลังตามหาอยู่คื\205 Guardian of Niddhog ผู้ซึ่งกำลังสับสนในจุดมุ่งหมายภายในป่าแห่งหมอก เมื่อออกไปจากป่า, อย่าลืมไปพบกับพวกเขาที\232 Mora Village"}
, Summary = ""}
, 
[7242] = {Title = "Play with the baby cat", 
Description = {"คำร้องขอจา\161 Rato กะลาสีแมวชั้นยอดใน Malangdo เขาเป็นกังวลเกี่ยวกับบรรดาลูกแมวมา\161 จึงร้องขอให้คุณไปหาและเล่นกับพวกเค้า ลูกแมวที่คุณต้องไปหามี Rosy แมวขาว Roku แมวด\211 แล\208 Charo แมวทอง"}
, Summary = ""}
, 
[7243] = {Title = "Nyadventure-Duruduru Compass", 
Description = {"คุณได้รั\186 Adventure card A จากลูกแมวที่เรียกตัวเองว่า ทีมผู้กล้าเหมียว \'Meow Bravery Team\' ดูเหมือนการ์ดจะใช้งานกับเครื่องจักรบางอย่างที่พวกเค้าทำขึ้นมาได้ ถ้าคุณสอดการ์ดเข้าไปใน Beginning Compass เกมจะเริ่มต้นขึ้\185 !"}
, Summary = ""}
, 
[7244] = {Title = "Nyadventure-Duruduru Race", 
Description = {"Duruduru Compass Race เริ่มต้นขึ้นแล้ว !!! คุณต้องผ่านการแข่งตามลำดับที่ถูกต้องในเวลาที่จำกัด ลำดับของตัวเข็มทิศคื\205 [Red Flame] -> [Blue Flame] -> [Gold Flame] -> [Forest] -> [Cloud]"}
, Summary = ""}
, 
[7245] = {Title = "Nyadventure-Duruduru Race", 
Description = {"Duruduru Compass Race เริ่มต้นขึ้นแล้ว !!! คุณต้องผ่านการแข่งตามลำดับที่ถูกต้องในเวลาที่จำกัด ลำดับของตัวเข็มทิศคื\205 [Gold Flame] -> [Blue Flame] -> [Cloud] -> [Forest] -> [Red Flame]"}
, Summary = ""}
, 
[7246] = {Title = "Nyadventure-I\'m coming now", 
Description = {"Charo บอกว่าแมวนักสืบอยู่ใกล้ๆ กับกองเรือนาวี ใกล้กับศูนย์กลาง Malangdo ไปพบกับพวกนักสืบและพวกสหายของเค้าซ\208"}
, Summary = ""}
