, 
[12099] = {Title = "Remove Root Cause", 
Description = {"นี่เป็นคงเป็นเพียงเรื่องเล็กๆสำหรับเจ้\210 ลูกๆของมังกรที่ใกล้กับรากของต้\185 Yggdrasil ได้ถูกจับไ\187 Eliminating ลูกๆของมังกรนั้น สำคัญมาก แต\232 เราไม่ควรที่จะมองข้ามเรื่องนี้ เพื่อป้องกันเรื่องที่อาจเกิดได้อีกในอนาค\181"}
, Summary = "Hunt 10 Draco\'s Eggs - Report to Hunting Dept. 1 Manager"}
, 
[12100] = {Title = "Violent Winged Insect", 
Description = {"ได้รับรายงานว่\210 มีผู้พบเห็นปีกแมลงขนาดใหญ่ ใกล้กั\186 Rapine camp เราคิดว่ามันอาจจะกระจายกำลังมากขึ้\185 ดังนั้\185 โปรดกำจัดมันเท่าที่คุณสามารถ"}
, Summary = "Hunt 12 Luciola Vespas - Report to Hunting Dept. 1 Manager"}
, 
[12101] = {Title = "Work Interference", 
Description = {"นี่เป็นเพียงแค\232 เพื่อนร่วมงานที่กลับมาจากทำงานภายในเหมือ\167 ลูกๆของมังกรที่อยู่ใกล้กันกับรากขอ\167 Yggdrasil ได้ทำลายพื้นที่รอบ\230 มันจะเกิดอันตรายถ้าเราไม่ระวังมั\185 กรุณากำจัดลูกๆของมังกร รอบๆ Yggdrasil"}
, Summary = "Hunt 5 Dracos - Report to Hunting Dept. 1 Manager"}
, 
[12102] = {Title = "Intelligent Snakes", 
Description = {"เผ่าพันธุ์ใหม่ นามว่า Naga ได้ถูกค้นพ\186 รอบๆ Rapine camp ปัญหาคือพวกเขาเป็นคนหัวโบราณ แล\208 รุนแรง เราจะมีปัญหากันมากในอนาคตหากพวกเขาขยายอณาเขตเข้ามา กรุณาไปกำจัด Nagas"}
, Summary = "Hunt 10 Nagas - Report to Hunting Dept. 1 Manager"}
, 
[12103] = {Title = "Legendary Creature", 
Description = {"เราได้รับรายงานต่อมาว่\210 พบเห็นปีกของม้าสีขาวข้างๆกับ Rapine base เจ้าช่วยไปที่นั้\185 แล้วกลับมาที? มันอาจจะเป็นเพียงภาพหลอน ดังนั้\185 เพื่อความแน่นอ\185 เจ้าช่วยลองสัมผัสมันดู ว่ามันเป็นสิ่งที่มีอยู่จริงหรือไม่"}
, Summary = "Hunt 1 Cornus - Report to Hunting Dept. 1 Manager"}
, 
[12104] = {Title = "Insects with an Appetite", 
Description = {"การขยายพันธุ์ของ Centipede มันจะเข้าทำร้ายสิ่งรอบข้าง เพื่อความอยู่รอบของตัวมันเอง และมันยังรวบรวมแร่ Bradium และสร้างความเสียหายภายในเหมืองอีกด้ว\194 พวกเราชา\199 Sapha ได้โดน Centipedes ทำร้ายมาเป็นจำนวนมาก กรุณากำจัดพวกมัน"}
, Summary = "Hunt 15 Centipedes - Report to Hunting Dept. 1 Manager"}
, 
[12105] = {Title = "Moving Rocks", 
Description = {"ได้รับรายงานว่าแร่ Bradium ภายในเหมืองกลับมามีชีวิต ดูเหมือนว่าแร่ดิบของ Bradium จะเปลี่ยนตัวเองกลายเป็\185 Golems โดยเวทย์มนตร์โบราณเพื่อปกป้องเหมืองนั้\185 เจ้าจงช่วยไปกำจัดพวกมันให้ที?"}
, Summary = "Hunt 10 Bradium Golems - Report to Hunting Dept. 1 Manager"}
, 
[12106] = {Title = "A child on the flower", 
Description = {"หน่วยสืบข่าวของเราที\232 Rapine ได้ถูกโจมตีจากสิ่งมีชีวิตรูปร่างน่ารักชนิดหนึ่\167 เราต้องการที่จะไล่พวกเขามันออกจากบริเวณโดยรอ\186, และเจ้าคือหนึ่งในผู้ช่วยครั้งนี้"}
, Summary = "Hunt 15 Pinguiculas - Report to Hunting Dept. 2 Manager"}
, 
[12107] = {Title = "Twisted Love", 
Description = {"เจ้ารู้เกี่ยวกับเด็กที่มีรูปร่างคล้ายกับดอกไม้หรือไม\232, Pinguicula? ผู้คนต่างพูดว่ามันเป็นการกลายพันธุ์ของเหล่าดอกไม้นี้ พวกมันโหดเหี้ยมและดุร่าย Rapine ส่งมาเพื่อจัดการกับมัน โปรดช่วยตรวจสอ\186 และปกป้องพื้นที่แถวนี้ที"}
, Summary = "Hunt 10 Dark Pinguicula - Report to Hunting Dept. 2 Manager"}
, 
[12108] = {Title = "Dangerous Plant Removal", 
Description = {"แร่บางชิ้นที่เก็บรวบรวมม\210 ได้สูญหายไ\187, และมันดูเหมือนจะเป็นการกระทำขอ\167 nepenthes, Nepenthes ดูคล้ายกันกั\186 Mandragora เจ้าช่วยกำจัดมันเพื่อไม่ให้มันไปทำร้ายคนอื่นที"}
, Summary = "Hunt 12 Nepenthes - Report to Hunting Dept. 2 Manager"}
, 
[12109] = {Title = "Larva Extermination", 
Description = {"พวกเขาค้นพบที่อยู่อาศัยของ centipede larva พวกเราสามารถนำมันออกไปได\233 ก่อนที\232 centipedes จะกลับมา เจ้าช่วยตามห\210 แล\208 กำจัดมันที? แต่เจ้าต้องระวังก่อนที่แม่ของพวกมันจะกลับมาด้ว\194"}
, Summary = "Hunt 14 Centipede Larvas - Report to Hunting Dept. 2 Manager"}
, 
[12110] = {Title = "Demon of Water", 
Description = {"เหมืองได้ขุด และมุ่งหน้าไปยังที่อยู่ของ Nidhogg, และมีรายงานว่า ได้มีการโจมตีจากสิ่งประหลาดเกิดขึ้\185 ผู้คนพูดว่ามันเป็นมนุษย์ที่มีร่างกายเป็นน้\211, แต่ดูแล้วมันน่าจะเป็นปีศาจมากกว่าจิตวิญญาณแห่งน้\211 บางทีภายใน Nidhogg Dungeon อาจมีพวกมันอยู\232 ช่วยสำรวจให้พวกเราที"}
, Summary = "Hunt 7 Aqua Elementals - Report to Hunting Dept. 2 Manager"}
, 
[12111] = {Title = "Bird with ugly face", 
Description = {"Tatachos เมื่อก่อนเคยเป็นนกที่สวยงา\193, และพวกมันสามารถบินได\233 แต่เนื่องจากบริเวณโดยรอบที่ปราศจากศัตรูตามธรรมชาติ, มันเริ่มที่จะอ้วนและขี้เกียจ, และตอนนี\233 มันก็เป็นอย่างที่เจ้าเห็นเนี่ยแหละ, นกที่แสนน่าเกียจ เจ้าอาจจะเป็นศัตรูตามธรรมชาติที่ดีสำหรับมันก็ได้"}
, Summary = "Hunt 10 Tatachos - Report to Hunting Dept. 2 Manager"}
, 
[12117] = {Title = "Withered Flower", 
Description = {"ผู้คนต่างพูดกันว่าบริเวณนี\233 เป็นพื้นที่ชุ่มน้ำเมื่อนานมาแล้ว และด้วยเหตุผลของประการ สภาพแวดล้อมแถวนี้ค่อยๆเปลี่ยนไ\187 ในส่วนพื้นที่รอบ\230 Rapine camp ยังคงถูกเก็บรักษาสภาพเดิมอยู\232 เจ้าช่วยนำจัวอย่างขอ\167 Withered Flower กลับมาที? มันจะเป็นตัวอย่างที่ดีในการสำรวจ"}
, Summary = "Collect 6 Withered Flowers - Report to Supply Dept. 1 Manager"}
, 
[12118] = {Title = "Welcomed Mineral", 
Description = {"เครื่องมือในการขุดค้นแร่ Bradium ได้รับความเสียหา\194 แล\208 ตอนนี้เราสร้าง Bradium ได้เพียงเวลาสั้น\230 เมื่ออยู่ภายในเหมือง ดังนั้นเราจึงอยากรบหวนท่านให้ช่วยเก็\186 Bradium กลับมาให้ท\213 กรุณารวบรว\193 3 refined Bradiums จา\161 Bradium Golem กลับมาที"}
, Summary = "Collect 3 Refined Bradium - Report to Supply Dept. 1 Manager"}
, 
[12119] = {Title = "Valuable Textile", 
Description = {"ข้าได้รับคำขอให้ช่วยนำ16 Dragon\'s Manes กลับมา, Dragon\'s Mane นั้นได้จาก Dracos ซึ่งหาได้ยากยิ่ง มันถูกใช้ในการออกแบบพื้นของธ\167, เสื้อผ้า แล\208 เครื่องสาธารณูปโภค"}
, Summary = "Collect 16 Dragon\'s Mane - Report to Supply Dept. 1 Manager"}
, 
[12120] = {Title = "Curious Meat", 
Description = {"นี่คือคำขอร้องจากผับ สำหรับอาหารที่หาได้ยากยิ่ง พวกเขาต้องกา\195 Dragon ส่วนประกอบที่ใช้สำหรับทำอาหา\195 หวังว่าผู้คนคงจะชอบมันนะ กรุณานำมันกลับมาให้ข้าซั\161 6 ชิ้นที"}
, Summary = "Collect 6 Dragon Tails - Report to Supply Dept. 1 Manager"}
, 
[12121] = {Title = "Materials to Clear Snow", 
Description = {"เส้นทางที่ออกจากเมือ\167 ตอนนี้มันอันตรายเนื่องจากหิมะที่ทับถ\193 ชิ้นส่วนขอ\167 Pieces of Egg Shells สามารถช่วยในการเดินทางได\233 และเราต้องการมันเป็นจำนวนมาก ประมาณซั\161 26 ชิ้น หรือมากกว่านั้นเท่าที่เจ้าสามารถทำได\233"}
, Summary = "Collect 26 Piece of Egg Shells - Report to Supply Dept. 1 Manager"}
, 
[12122] = {Title = "Best Cooler Material", 
Description = {"เครื่องผลิ\181 Bradium แปรรูปความร้อนออกมาในการใช้งาน แล\208 ไม่สามาร\182 คงค่าสภาวะไว้ได้ ดังนั้\185 เราจึงต้องนำ Crystalized Teardrops ที่ได้จา\161 Aqua Elementals เข้ามาร่วมใช้งานด้วย และนี่คือวัตถุดิบที่เราต้องการ นำมันกลับม\210 6 ชิ้นก็เพียงพ\205"}
, Summary = "Collect 6 Crystalized Teardrop - Report to Supply Dept. 1 Manager"}
, 
[12123] = {Title = "Best Paint", 
Description = {"มีการขอร้องมาอย่างเร่งด่วนจา\161 ผู้จัดการฝ่ายผลิ\181 เพื่อบำรุงรักษาอาคาร โดยรอบเมือ\167 เขาสามารถทำให้มันเพียงพอสำหรับการจัดกา\195 เพียงน\211 Fluorescent Liquid ที่ได้จา\161 Aqua Elementals กลับมาประมาณ 26 ชิ้น ก็น่าจะเพียงพอ"}
, Summary = "Collect 26 Fluorescent Liquid - Report to Supply Dept. 1 Manager"}
, 
[12124] = {Title = "Rare Valuable", 
Description = {"ขวดน้ำแร่ที่มีค่าภายในห้องพักของท่านรัฐมนตรีได้รับความเสียหา\194 ไม่รู้ว่าใครคนทำ แต่มันจำเป็นที่จะต้องใช้มา\161 ดังนั้นช่วยหาสิ่งทดแทนได้ท\213 บางที่ Aqua Elemental อาจจะมีมันอยู่? แค\232 1 ชิ้น ก็น่าจะพ\205"}
, Summary = "Collect 1 Small Bottle - Report to Supply Dept. 1 Manager"}
, 
[12125] = {Title = "Armory Material", 
Description = {"วัสดุสำหรับสร้างเกราะป้องกันสำหรับ Guards หมดคลังในตอนนี\233 เกร็ดจาก Naga เป็นวัสดุชั้นเยี่ยมที่จะนำมาใช้ทดแทน กรุณานำกลับมาซัก 18 ชิ้น"}
, Summary = "Collect 18 Scale Shells - Report to Supply Dept. 1 Manager"}
, 
[12126] = {Title = "Advanced Armory Material", 
Description = {"ข้าได้รับคำขอร้องให้นำวัสดุที่มาใช้แทนชุดป้องกันสำหรับเหล่\210 guard commanders มันอาจแตกต่างจาก วัสดุเดิมที่เจ้าเคยนำม\210 กรุณาน\211 11 shining scales จา\161 Naga กลับมาที ข้าคิดว่ามันไม่น่าจะเป็นเรื่องยากสำหรับเจ้\210"}
, Summary = "Collect 11 Shining Scales - Report to Supply Dept. 1 Manager"}
, 
[12127] = {Title = "Supervisor\'s Tool", 
Description = {"ถึงเวลาที่จะต้องซ่อมแซ\193 trumpets สำหรับผู้บังคับบัญชาภายในเหมือ\167 Mine เพราะว่า trumpets เป็นสิ่งจำเป็นในการใช้ควบคุมพฤติกรรมของคนงานภายในเหมือ\167, mystic horn ที่ได้จา\161 Cornus คือวัสดุชั้นเยี่ยม, นำมันกลับม\210 5 ชิ้นเพื่อใช้งา\185"}
, Summary = "Collect 5 Mystic Horns - Report to Supply Dept. 2 Manager"}
, 
[12128] = {Title = "Preparation for Heating", 
Description = {"ดูเหมือนจะไม่ม\213 fur เพียงพอสำหรับนักเดินทา\167 สามารถหามันได้จา\161 Tatacho. ซั\161 21 ชิ้นก็น่าจะพอน\208"}
, Summary = "Collect 21 Fur - Report to Supply Dept. 2 Manager"}
, 
[12129] = {Title = "Suspicious Food", 
Description = {"นี่เป็นคำขอร้องของผั\186 ให้ช่วยน\211 27 bug legs กลับมา ไม่รู้ว่าทำไมพวกเขาถึงต้องการใช้มั\185 แต่อย่างไรก็ตา\193, ช่วยทีนะ"}
, Summary = "Collect 27 Bug Legs - Report to Supply Dept. 2 Manager"}
, 
[12130] = {Title = "Useful Material", 
Description = {"Zargon เป็นที่นิยมเป็นอย่างมากในหมู่ประชาชน มันสวยงามมาก, และสามารถทำมันเป็นแป้งสำหรับบำรุงผิวได้เพียงผสมมันกับน้ำเท่านั้น ได้ยินมาว่ามันเป็นเพียงวัสดุธรรมดา เจ้ามีมันบ้างหรือไม่หล\208? น่าจ\208 26 Zargons ก็เพียงพ\205"}
, Summary = "Collect 26 Zargon - Report to Supply Dept. 2 Manager"}
, 
[12131] = {Title = "Essential Material for Construction", 
Description = {"นี่เป็นคำขอร้องเพื่อตามหาวัสดุที่นำมาใช้ในการบำรุงรักษาอาคาร บ้านเรือนประจำปี, 13 Solid shells ที่ได้จา\161 Centipede แล\208 Centipede Larva น่าจะเป็นวัสดุที่ใช้ประโยชน์ได้อย่างมา\161"}
, Summary = "Collect 13 Solid Shells - Report to Supply Dept. 2 Manager"}
, 
[12132] = {Title = "Essential Material for Construction 2", 
Description = {"นี่เป็นคำขอร้องเพื่อตามหาวัสดุที่นำมาใช้ในการบำรุงรักษาอาคาร บ้านเรือนประจำปี, 16 Strong vines ที่สามารถหาได้จา\161 nepenthes. น่าจะเป็นวัสดุที่ใช้ประโยชน์ได้อย่างมา\161"}
, Summary = "Collect 16 Strong Vines - Report to Supply Dept. 2 Manager"}
, 
[12133] = {Title = "Decoration arrangement", 
Description = {"Guard ต้องการที่จะใช\233 sharp leaves จำนวนมากสำหรับการตกแต่\167 นักผจญภัยบางคน เริ่มจะมองหามั\185 พวกเขาต้องการมันซักจำนวนหนึ่\167 ข้าคิดว่\210 26 sharp leaves ที่ได้จากเจ้าก็น่าจะเพียงพ\205 ข้ารู้ว่ามันยา\161 แต่ก็ขอให้เจ้าโชคด\213!"}
, Summary = "Collect 26 Sharp Leaves - Report to Supply Dept. 2 Manager"}
, 
[12134] = {Title = "Instant Receptacle", 
Description = {"เจ้าของผับสร้างปัญหาให้กับนักผจญภัยเป็นอย่างมา\161 เขาต้องการภาชนะที่สามารถใช้งานได้อย่างทันท\213"}
, Summary = "Collect 11 Great Leaves - Report to Supply Dept. 2 Manager"}
, 
[12135] = {Title = "Not enough medicine", 
Description = {"มีการโจมตีเกิดขึ้นภายในเหมือ\167 อาจจะเป็นพวก Nepenthes ที่พยายามที่จะโจมตีเหมืองอยู\232 เพื่อทำยารักษาคนงา\185, เราต้องการ 16 brown roots ช่วยนำมันกลับมาท\213"}
, Summary = "Collect 16 Brown Root - Report to Supply Dept. 2 Manager"}
, 
[12136] = {Title = "Honey robber", 
Description = {"เจ้าของผับมาตำหนิพวกเร\210 อย่างรุนแร\167 เขากล่าวว่\210 honey หมดไปจากภายในร้า\185 ดังนั้\185 honey 2 เหยือก น่าจะเพียงพอสำหรับเข\210"}
, Summary = "Collect 2 Honey - Report to Supply Dept. 2 Manager"}
, 
[12137] = {Title = "Tools for Experiment", 
Description = {"ศูนย์การวิจัยอุตสาหกรรมการวิจัยวิธีการกลั่\185 Bradium ได้อย่างมีประสิทธิภา\190 แต่พวกเขามักมีเวลาเพียงสั้\185 \230 เกี่ยวกับการทดสอบวัสดุ ข้าได้ยินมาว่าผู้ประกอบการค้าถายในเมืองนั้นมีขาย Life Force Pots ข้าต้องการมันซัก 4 ชิ้น"}
, Summary = "Collect 4 Life Force Pots - Report to Transport Dept. 1 Manager"}
, 
[12138] = {Title = "Fine Gift Samples", 
Description = {"เจ้าของผับกล่าวว่าเขาต้องการที่จะมอบของขวัญให้แก่ลูกค้าชาว Sapha แต่ไม่รู้ว่าจะมอบอะไรให้ดี ถ้าเจ้ารู้เกี่ยวกับของขวัญภายในเมือง Midgard, ช่วยนำมันกลับมาซัก 5 ชิ้นได้หรือไม่?"}
, Summary = "Collect 5 Bouquets - Report to Transport Dept. 1 Manager"}
, 
[12139] = {Title = "Respect for Taste!", 
Description = {"รัฐมนตรีว่าการกระทรวงระดับสูงได้มองหาผลิตภัณฑ์ของเมือง Midgard, Witherless Roses \179 วันนี้ มันอาจไม่ใช่ของที่ดีนั\161 แต่บางคนก็ยังต้องการมันอยู่ด\213 ดังนั้\185... ข้ารู้ว่ามันยากที่จะรบกวนเจ้\210 แต่ช่วยน\211 1 Witherless Rose กลับมาที นี่เป็นเรื่องระหว่างข้ากับเจ้านะ"}
, Summary = "Collect 1 Witherless Rose - Report to Transport Dept. 1 Manager"}
, 
[12140] = {Title = "Courtesy for Regulars", 
Description = {"คำขอร้องจากเจ้าของผั\186 เขากล่าวว่าเขาไม่สามารถใช้จานที่ใช้แล้วทิ้งแก่ลูกค้าประจำได้ ดังนั้นเขาจึงขอร้อ\167 ให้ช่วยตามหา 15 solid, white chinas จา\161 Midgard ให้ท\213"}
, Summary = "Collect 15 Chinas - Report to Transport Dept. 1 Manager"}
, 
[12141] = {Title = "Special Package", 
Description = {"ข้าได้รับคำขอร้องส่วนตัว ข้าได้ยินมาว่ามีความเป็นหัตถกรรมโปร่งใสแห่\167 Midgard ข้าคิดว่ามันถูกเรียกว่\210 Glass Beads เรามีรายการที่ผลิตที่คล้ายกันที่นี\232 แต่ไม่มีอะไรเทียบกับรูปทรงกลมมีทำออกมาอย่างละเอียดนั้นได้เลย ช่วยนำมันกลับมาซัก 10 ชิ้นให้ข้าที"}
, Summary = "Collect 10 Glass Beads - Report to Transport Dept. 1 Manager"}
, 
[12142] = {Title = "Dangerous Request", 
Description = {"อืมมมม... ข้าไม่รู้ว่าจะเริ่มอย่างไร รัฐมนตรีระดับสูงขอร้องให้ช่วยน\211 puppet กลับมาจา\161 Midgard ข้าไม่รู้ว่ามันคืออะไร แต่ตั้งแต่ท่านรัฐมนตรีขอร้องเกี่ยวกับสิ่งนี้, ดูเหมือนมันจะกลายเป็นสิ่งสำคัญทีเดีย\199 กรุณานำกลับมาซัก 15 ชิ้นก็น่าจะเพียงพอ"}
, Summary = "Collect 15 Puppets - Report to Transport Dept. 1 Manager"}
, 
[12143] = {Title = "Strange Trend", 
Description = {"ข้าได้ยินมาว่ามีคนจำนวนมากสะสมเครื่องดนตรีต่าง\230 ที่สร้างจา\161 Bill of Birds แห่ง Midgard ข้าคิดว่าจะลองเผยแพร่มันในการดำเนินงานสร้างอาคารครั้งนี้ดู ข้าได้ยินมาว่าพ่อค้าภายในเมือง Midgard ขายมันอยู่ เจ้าช่วยนำมันกลับม\210 50 ชิ้น ให้ข้าที ?"}
, Summary = "Collect 50 Bill of Birds - Report to Transport Dept. 1 Manager"}
, 
[12144] = {Title = "Unknown Usag", 
Description = {"เจ้าของผับกล่าวว่าเขาต้องการในการตกแต่งภายในผับด้วยสิ่งที่เรียกว่า Clam Shells. นำมันกลับม\210 50 ชิ้น เขาพูดว่ามันเป็นสิ่งมีชิวิตภายในท้องทะเล ดังนั้นข้าคงไม่มีรู้เรื่องเกี่ยวกับมันมากนัก แต\232 ข้าคิดว่าว่าเจ้าอาจจะรู้จักมันก็ได\233"}
, Summary = "Collect 50 Clam Shells - Report to Transport Dept. 1 Manager"}
, 
[12145] = {Title = "Other World Cuisine", 
Description = {"เราไม่ได้มีอาหารที่ดีสำหรับตัวเอ\167 แต่ดูเหมือนนักผจญภัยทั้งหลายจะเพลิดเพลินไปกับศิลปะของการรับประทานอาหารของเรา ดังนั้นเจ้าของผับจึงคิดเมนูใหม\232 ขอขอร้องให้น\211 20 Crab Shells กลับมา... ขอให้เจ้าโชคดี"}
, Summary = "Collect 20 Crab Shells - Report to Transport Dept. 1 Manager"}
, 
[12146] = {Title = "Filling in Cracks", 
Description = {"ข้าคิดว่าไอเทมที่ถูกใช้งานมากที่สุดใ\185 Midgard คื\205 Scells ใช\233 Scells เพื่อเติมรอยหรือหลุมในอาคารและแล้วผสมและฉาบปูนบดกั\186 Garlet ในอาคา\195 และยังมีการเก็บรักษาที่รวดเร็วและเรียบง่าย เจ้าช่วยนำกลับมาซั\161 30 ชิ้นให้ท\213?"}
, Summary = "Collect 30 Scells - Report to Transport Dept. 1 Manager"}
, 
[12147] = {Title = "Adhesive Material", 
Description = {"Garlets คือแร่ธาตุชั้นยอดในการสร้างผลงาน รองจาก Scells, มันเป็นวัตถุดิบที่สำคัญในการสร้างอาคารเช่นเดียวกัน ก่อน Garlets จะได้เริ่มใช้งาน, เราเคยใช\233 Zargons มาก่อน แต่มันกลับยากที่จะใช้งานยิ่งนั\161 ดังนั้นนำมันกลับมาให้ข้าซั\161 40 ชิ้นที"}
, Summary = "Collect 40 Garlets - Report to Transport Dept. 1 Manager"}
, 
[12148] = {Title = "Bait for Tatacho Hunting", 
Description = {"เหล่\210 Tatachos รวดเร็วมาก หากเราคิดจะจับมั\185 ดังนั้\185 จึงจำเป็นที่จะต้องใช\233 Monster\'s Feed ข้าได้ยินมาว่ามีสามารถผลิตมันได้เองอยู\232, นำ 100 Monster\'s feed กลับมาที"}
, Summary = "Collect 100 Monster\'s Feed - Report to Transport Dept. 2 Manager"}
, 
[12149] = {Title = "Swordmanship Practice", 
Description = {"เจ้าของผับต้องกา\195 Apples ซักจำนวนหนึ่\167 เพื่อเรียนรู้การทำอาหารเพิ่มเติม แต่เคยได้ยินมาว่\210 นักผจญภัยจาก Midgard ใช้มันเป็นอาหารนานมาแล้ว แต่เขาจะลองด\217, ดังนั้\185 นำ 100 กลับมาให้เขาที"}
, Summary = "Collect 100 Apples - Report to Transport Dept. 2 Manager"}
, 
[12150] = {Title = "Pretty reddish vegetable", 
Description = {"นี่เป็นคำขอจากเจ้าของผับ เขาต้องการผักที่มีสีสว\194 เพื่อใช้ในการตกแต่\167 ที่ยอดเยี่ยมที่สุดคงเป็น.. Carrot, มันถูกเรียกว่าอย่างนั้นใช่มั้ย? ไม่รู้ว่ามันถูกเรียกว่าอย่างไรเหมือนกั\185 ข้าก็ไม่มีข้อมูลเกี่ยวกับเรื่องนี้เล\194..... ขอโทษด้ว\194 ดังนั้\185 เจ้าช่วยนำมันกลับม\210 100 ชิ้นแล้วกั\185"}
, Summary = "Collect 100 Carrots - Report to Transport Dept. 2 Manager"}
, 
[12151] = {Title = "Tenacity of the pub owner", 
Description = {"มีคนพูดกันว่าเกิดระเบิดชึ้นภายในผั\186 ผู้คนต่างพูดกันว่า มันเกิดจากผักชนิดหนึ่งที่ถูกเรียกว่า Pumpkin เมื่อมันถูกโยนลงในเตาไ\191 เนื่องจากเหตุการณ์ครั้งนี้, ทำให้ไม่มี pumpkin เหลืออยู่เลย ดังนั้นมันจะดีมากถ้าเจ้านำ 100 pumpkins กลับมา"}
, Summary = "Collect 100 Pumpkins - Report to Transport Dept. 2 Manager"}
, 
[12152] = {Title = "Taste like home cooking", 
Description = {"เจ้าของผับได้ขอเกี่ยวกับสิ่งนี\233.... เขาต้องการ sweet potato ที่เขาเคยได้ลิ้มรสมั\185 เมื้อครั้งที่ยังเด็กอยู่ เขาต้องการ 50 sweet potatos ข้าคิดว่าข้าเข้าใจเขาน\208 สำหรับผู้ที่ห่างหายจากบ้านมาเป็นเวลานา\185 ดังนั้นหากเจ้าไปยั\167 Midgard, ช่วยนำมันกลับมาท\213"}
, Summary = "Collect 50 Sweet Potatos - Report to Transport Dept. 2 Manager"}
, 
[12153] = {Title = "Harzardous plant when burnt", 
Description = {"เจ้าของผับต้องการทำอาหารบางอย่างที่แปลกยิ่งขึ้\185 เขากล่าวว่ามันคื\205 Roasted Banana แต่เขาคิดว่ามีบางสิ่งที่เคยถูกเรียกแบบนี้มาก่อ\185...? เอ่อ..., ข้าจำไม่ได้แล้วเหมือนกัน อย่างไรก็ตาม... เจ้าช่วยนำ 100 Bananas กลับมาที"}
, Summary = "Collect 100 Bananas - Report to Transport Dept. 2 Manager"}
, 
[12154] = {Title = "Unexpectedly Normal", 
Description = {"คำขอร้องจากเจ้าของผั\186 เขาต้องการเนื้อบางส่วน ไม่มีอะไรพิเศษในคำพูดของเข\210 มันน่าจะเพียงพอสำหรั\186 50 ชิ้น ข้ารู้แปลกใจจริง ดูเขาค่อนข้างยุ่งทีเดียว.."}
, Summary = "Collect 50 Meat - Report to Transport Dept. 2 Manager"}
, 
[12155] = {Title = "Present with heart", 
Description = {"ข้าต้องการจะส่งของขวัญไปยั\167 Barkeeper นี้เป็นคำขอส่วนตัวดังนั้นทำมันอย่างสบายๆ ข้าพบกับ barkeeper และพบว่า scoops ทั้งหมดของเขาล้วนเสียหาย ข้าคิดว่าเขาถามถึงมันน\208 แต\232, ข้าขอโทษเกี่ยวกับเข้าด้ว\194 ดังนั้\185, โปรดมอ\186 20 black scoops ที่เจ้าสามารถซื้อได้ที\232 Midgard ให้แก่ข้าท\213"}
, Summary = "Collect 20 black scoops. - Report to person in charge from transport 2 team"}
, 
[12156] = {Title = "Respect personal appetite!-2", 
Description = {"นายกรัฐมนตรีขอให้นำกระจกคริสตัลกลับมาจาก Midgard กระจกนี้อยู่ที\232 capital Manuk แต่เขายังชื่นชอบสิ่งที่ได้จา\161 Midgard มากกว่\210 ข้าเกรงกลัวในความต้องการของเขา แต\232 ข้าคิดว่ามันคงต้องมีเหตุผลบางประการนั้นแหล\208"}
, Summary = "Collect 5 crystal mirrors - Report to person in charge from transport 2 team"}
, 
[12157] = {Title = "Pledge of barkeeper", 
Description = {"ถายในระยะเวลานี้, Barkeeper เขาขอให้ข้าส่งคำพูดบางอย่างเกี่ยวกับ 2 pineapples กับเจ้\210 [ ข้าต้องการที่จะสร้าง special cocktail สูตรพิเศ\201 ดังที่ข้าเคยทำพิษออกมาได้อย่างยอดเยี่ยมครั้งก่อน\230 , ข้ามั่นใจในการผสมมันอย่างมาก] นี่คือคำร้องจากเขา, ข้าคิดว่ามันแปลกๆน\208 แต\232 อื\193, อย่าลืมที่ข้าพูดแล้วกั\185"}
, Summary = "Collect 2 pineapple - Report to person in charge from transport 2 team"}
, 
[12158] = {Title = "Rage of barkeeper", 
Description = {"ภายในเวลานี้, อีกครั้งขอ\167 Barkeeper. เขาขขอร้องข้าให้ส่งคำพูดบางอย่างกับเจ้าเกี่ยวกับ 2 melons. [ ข้าต้องการที่จะสร้าง special cocktail สูตรพิเศ\201 ดังที่ข้าเคยทำพิษออกมาได้อย่างยอดเยี่ยมครั้งก่อน\230 , ข้ามั่นใจในการผสมมันอย่างมาก] ข้าคิดว่าเจ้าเคยได้ยินมันมาแล้วน\208"}
, Summary = "Collect 2 melons - Report to person in charge from transport 2 team"}
, 
